import React from "react"
import Modal from 'react-modal';


export type Props = {
    isOpen: boolean
    onRequestClose: () => void
}

const InfoModal: React.FC<Props> = ({isOpen, onRequestClose}) => {
    Modal.setAppElement('#root');
    return (
      <Modal isOpen={isOpen} onRequestClose={onRequestClose}>
          <div>
              I am Lisa, a Ukrainian from Kharkiv who has lived in Germany for the past 16 years. Why I did this project, how the orgs are selected, it is a one-woman show etc etc.
          </div>
      </Modal>
    )
}

export default InfoModal
